import React from 'react';
import { Container, Image } from 'react-bootstrap';
import '../home.css';


const Home:React.FC = () => {
    return (
     <Container className='mt-5' >
        <h1>  Hi, I'm  Ionut Ciornei front-end developer!
        <Image src="/img/me.jpg" alt="me" fluid className='imgStyle'/>
        </h1>
       
     </Container>      
    )
};

export default Home;
